import "./UserPage.scss";
import { useNavigate } from "react-router";

const UserPage = () => {
  const navigate = useNavigate();

  const logout = () => {
    localStorage.removeItem("Token");
    navigate("/login");
  };

  return (
    <button className="logout-button" onClick={logout}>
      Logout
    </button>
  );
};

export default UserPage;
